import React from "react";

function Icon() {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width="100"
      height="100"
      fill="#000"
      className="icon line"
      viewBox="0 0 100 20"
    >
      <path
        fill="none"
        stroke="#000"
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth="1.5"
        d="M12 3a9 9 0 109 9 9 9 0 00-9-9zm0 4v5m.69 4.63l2.14-3.13a1 1 0 00-.69-1.5H9.86a1 1 0 00-.69 1.5l2.14 3.12a.82.82 0 001.38.01z"
      ></path>
    </svg>
  );
}

export default Icon;
